import React, { useState, useEffect } from 'react';
import axios from "axios";
import exportFunc from './lib.js';
import './App.css';

function SideMenu() {
  return (
    <div>
      <a href="https://www.city.hachinohe.aomori.jp/corona/index.html" target="_blank">
        新型コロナウイルス感染症に関する情報（八戸市）
      </a>
      <a href="https://www.pref.aomori.lg.jp/koho/coronavirus_index.html" target="_blank">
        新型コロナウイルス感染症に関する情報（青森県庁）
      </a>
      <a href="https://www.pref.iwate.jp/kurashikankyou/iryou/covid19/index.html" target="_blank">
        新型コロナウイルス感染症に関する情報（岩手県庁）
      </a>
      <a href="https://www.pref.aomori.lg.jp/koho/message.html" target="_blank">
        青森県知事からのメッセージ
      </a>
      <a href="https://www.daily-tohoku.news/" target="_blank">
        デーリー東北新聞社ニュースサイト
      </a>
    </div>
  );
}
export default SideMenu;
